import './App.css';
import { React } from 'react';
import { ApolloClient, ApolloProvider } from "@apollo/client";

const client = new ApolloClient({
  uri: "http://localhost:4000",
})

class App extends React.Component {
  render() {
    return (
      <ApolloProvider client={client}>
        <div className="App">
        </div>
      </ApolloProvider>
    )
  };
}

export default App;
